import React from "react";
import ProjectItem from "../project-item/project-item.component";


export default function ProjectList({ projects }) {
  let noItemFlag = false;
    if(!projects){
        projects = [];
        noItemFlag = true;
    }
 
  return (
    <div>

        {noItemFlag?
        projects.map(({ published, projectBudget, totalTasks, completedTasks, projectName, projectStatus, _id}, index ) => {
          
          return (
          
            <ProjectItem published = {published} projectBudget = {projectBudget} totalTasks={totalTasks} completedTasks={completedTasks} key={_id} projectName = {projectName} projectStatus = {projectStatus} id={_id}/>
            
          );
        })
        :
        <p>Nothing matched the search.</p>
      }
    </div>
  );
}
